class Viewership extends React.Component {
  constructor() {
    super();
    console.log("line constructed");
    this.state = {
      data: dataYear[2019],
      value: 2019,
    };
  }

  yearChange = (event) => {
    this.setState({
      data: dataYear[event.target.value],
      value: event.target.value,
    });
  }

  render() {
    return (
      <div className="container">
        <h1>Twitch Viewership Data (2016 - 2019)</h1>
        <select value={this.state.value} onChange={this.yearChange}>
          <option value="2016">2016</option>
          <option value="2017">2017</option>
          <option value="2018">2018</option>
          <option value="2019">2019</option>
        </select>
        <Line
          data={this.state.data}
          width={200}
          height={100}
          options={{
            legend: {
              display: true
            },
            pan: {
              enabled: true, // Enable panning
              mode: "x", // Allow panning in the x direction
              rangeMin: {
                x: null // Min value of the delay option
              },
              rangeMax: {
                x: null // Max value of the delay option
              }
            },
            zoom: {
              enabled: true, // Enable zooming
              mode: "x", // Allow zooming in the x direction
              rangeMin: {
                x: null // Min value of the duration option
              },
              rangeMax: {
                x: null // Max value of the duration option
              }
            },
            responsive: true,
            maintainAspectRatio: true,
            tooltips: {
              callbacks: {
                // this callback is used to create the tooltip label
                label: function(tooltipItem, data) {
                  // get the data label and data value to display
                  // convert the data value to local string so it uses a comma seperated number
                  var dataLabel = data.datasets[tooltipItem.datasetIndex].label;
                  // add the currency symbol $ to the label
                  var revenue = data.datasets[tooltipItem.datasetIndex].data[tooltipItem.index].y;
                  revenue = Math.trunc(revenue);
                  var value = ': ' + commaFormat(revenue);
                  dataLabel += value + ' viewers';
                  // return the text to display on the tooltip
                  return dataLabel;
                }
              }
            },
            scales: {
                yAxes: [{
                    scaleLabel: {
                        display: true,
                        labelString: '# of Viewers at 5:00 PM',
                        fontStyle: 'bold',
                        fontSize: 20
                    },
                   ticks: {
                     beginAtZero: true,
                     callback: function(value, index, values) {
                       if(parseInt(value) >= 1000){
                         return value.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
                       } else {
                         return value;
                       }
                     }
                   }
               }],
               xAxes: [{
                   scaleLabel: {
                       display: true,
                       labelString: 'Date',
                       fontStyle: 'bold',
                       fontSize: 20
                   },
                   ticks: {
                     callback: function(value, index, values) {
                       return value.replace("17:00:00.000", "");
                     }
                   }
               }],
            },
          }}
        />{" "}
      </div>
    );
  }
}

export default Viewership;


function commaFormat(value) {
  if(parseInt(value) >= 1000){
    return value.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
  } else {
    return value;
  }
}
